import React from 'react';
import * as instancesVal from '../instances_val2017.json';

export function parseSuperCategories(): string[]{
	//console.log(typeof (instancesVal));
	return (<any>instancesVal).categories.map((item:any) => item.supercategory).filter((value:any, index:any, self:any) => self.indexOf(value) === index);
};
